function Contactusform() {
    return (
        <>
            <h1> Contactusform</h1>
            {/* <!-- Wrapper container --> */}
            <div class="container py-4">

                {/* <!-- Bootstrap 5 starter form --> */}
                <form action="/Contactusform" method="post">

                    {/* <!-- Name input --> */}
                    <div class="mb-3">
                        <label class="form-label" for="name">Name</label>
                        <input class="form-control" id="name" type="text" placeholder="Name" name="namecon"/>
                    </div>

                    {/* <!-- Email address input --> */}
                    <div class="mb-3">
                        <label class="form-label" for="emailAddress">Email Address</label>
                        <input class="form-control" id="emailAddress" type="email" placeholder="Email Address" name="emailcon"/>
                    </div>

                    {/* <!-- Message input --> */}
                    <div class="mb-3">
                        <label class="form-label" for="message">Message</label>
                        <textarea class="form-control" id="message" type="text" placeholder="Message" name="msgcon"></textarea>
                    </div>
{/* 
                    <!-- Form submit button --> */}
                    <div class="d-grid">
                        <button class="btn btn-primary btn-lg" type="submit">Submit</button>
                    </div>

                </form>

            </div>

        </>
    )
}

export default Contactusform;
